USE [WBS-PGS]
GO
ALTER PROCEDURE insertIntoTableTRS_Vehicle (@Mill VARCHAR(64), @VehicleNo VARCHAR(64), 
							@Driver VARCHAR(128), @Supplier VARCHAR(256), @TripDate VARCHAR(256),
							@Post VARCHAR(64), @Status VARCHAR(16), @StatusDate VARCHAR(128),
							@Photo VARCHAR(MAX), @Security VARCHAR(128))
AS
BEGIN
	DECLARE @imageCount int;
	SELECT @imageCount = COUNT(*) + 1 FROM TRS_VehicleImage;
	DECLARE @imagePath VARCHAR(512);
	SET @imagePath = 'D:\TRSVehicleImages\' + CONVERT(VARCHAR(64), @imageCount) + '.JPG';
	print @imagePath;

	DECLARE @PhotoInBinary VARBINARY(MAX);
	SET @PhotoInBinary = CONVERT(VARBINARY(MAX), '' + @Photo, 0);

	DECLARE @Command VARCHAR(4096);
    SET @Command = 'bcp "' + convert(VARCHAR,@Photo) + '" queryout "' + @imagePath + '" -c -UTF8 -T -Slocalhost';
    PRINT @Command; -- debugging 


	EXEC master.dbo.sp_configure 'show advanced options', 1;
	RECONFIGURE WITH OVERRIDE;


	EXEC master.dbo.sp_configure 'xp_cmdshell', 1;
	RECONFIGURE WITH OVERRIDE;

	EXEC xp_cmdshell @Command;

	EXEC sp_configure 'xp_cmdshell', 0

	EXEC master.dbo.sp_configure 'xp_cmdshell', 0
	RECONFIGURE WITH OVERRIDE


	EXEC master.dbo.sp_configure 'show advanced options', 0
	RECONFIGURE WITH OVERRIDE
     
	-- SELECT * FROM TRS_Vehicle;
END

